/* crediting github: briancodex for to do functionality used his components
from https://github.com/briancodex/react-todo-app-v1 for to do section of this
react app */
import './App.css';
import TodoList from './components/TodoList';
import ReviewList from './components/ReviewList.js';
import {BrowserRouter, Route, Routes} from "react-router-dom";

function App() {
  return (
      <BrowserRouter>
       <Route exact path="localhost:3000" element={<TodoList/>}></Route>
       <Route exact path="localhost:3000/review" element={<ReviewList/>}></Route>
      </BrowserRouter>
  );
}

export default App;
